Alexandre Garcia,
Se as pesquisas são contratadas pelo partido interessado;
Se as pesquisas são realizadas por empresas privadas com fins lucrativos;
Se as pesquisas influenciam tendenciosamente os eleitores;
Não seria sensato proibir a sua divulgação ao público e ser usada apenas como norte para o partido???

Wilson da Silva Moraes de Registro SP
